    def exportToExcel_visits(self):
            columnHeaders = []

            # create column header list
            for j in range(self.table_visits.model().columnCount()):
                columnHeaders.append(self.table_visits.horizontalHeaderItem(j).text())

            df = pd.DataFrame(columns=columnHeaders)

            # create dataframe object recordset
            for row in range(self.table_visits.rowCount()):
                for col in range(self.table_visits.columnCount()):
                    df.at[row, columnHeaders[col]] = self.table_visits.item(row, col).text()

            df.to_excel('visits.xlsx', index=False)
            print('Excel file exported')

